import React from 'react';
import './style.css';
import imgLogo from '../../assets/imagens/logo1.png';

import Pageheader from '../../Componentes/Pageheader';


export default function Inicio(){
    return(
    

        <div>
            <Pageheader/>
            <div className="">
                    <div className="container" id="container">
                         <div className="d-flex justify-content-center"> <img id="logo" src={imgLogo} class="img-fuid" alt=""/></div>
                         
                    </div>
            </div>
        </div>

    );
}
